import { IoIosSearch } from 'react-icons/io';
export default function SearchBox() {
    const searchHelper = () => console.log('search fired');
    return(
        <div className='flex no-wrap h-8 w-2/6 border border-black m-5'>
            <IoIosSearch className='w-8 my-auto'/>
            <input className='w-full outline-none' name='search' placeholder='Search Everywhere' onChange={searchHelper}/>
        </div>
    )
}
